import React from "react";
import reactDOM from 'react-dom'
const userName='Mehedi Hasan'
const rootDirectory= document.getElementById('root')
// Generete a random number from 0 to 100
const luckyNum= Math.floor(Math.random()*100)
// Creates the current year value: 
const currentDate= new Date()
const currentYear= currentDate.getFullYear()
// console.log(currentDate)





reactDOM.render(<div>
  <h1>Here is a list created by using react DOM</h1>
  <ul>
    <li>First Item</li>
    <li>Second Item</li>
    <li>Third Item</li>
  </ul>
  <h2>Today it's : {currentDate}</h2>
  <h1>Click the button bellow to get your lucky number: </h1>
  <button type="submit">Click Here!</button>
  <p>Your luck number is: {luckyNum}</p>


  <footer>
    Copyrights all reserved by {userName} {currentYear} 
  </footer>
</div>, rootDirectory)

